import React, { useState } from 'react';
import { Search, Copy, CheckCircle, XCircle, AlertTriangle, Clock } from 'lucide-react';
import './App.css';

const App = () => {
  const [businessInput, setBusinessInput] = useState('');
  const [result, setResult] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [copied, setCopied] = useState(false);

  const responses = {
    notFound: {
      status: 'Business Not Found',
      icon: <XCircle className="w-6 h-6 text-red-500" />,
      color: 'border-red-200 bg-red-50',
      message: `Hello,\n\nI've searched our records and was unable to locate a business matching "${businessInput}". This could be due to... [etc]`
    },
    einMismatch: {
      status: 'EIN Mismatch',
      icon: <AlertTriangle className="w-6 h-6 text-yellow-500" />,
      color: 'border-yellow-200 bg-yellow-50',
      message: `Hello,\n\nI've located the business "${businessInput}" in our system, however there appears to be a mismatch... [etc]`
    },
    watchlistHit: {
      status: 'Watchlist Hit',
      icon: <Clock className="w-6 h-6 text-orange-500" />,
      color: 'border-orange-200 bg-orange-50',
      message: `Hello,\n\nThank you for your submission. The business "${businessInput}" has been flagged... [etc]`
    },
    verified: {
      status: 'Verified',
      icon: <CheckCircle className="w-6 h-6 text-green-500" />,
      color: 'border-green-200 bg-green-50',
      message: `Hello,\n\nGreat news! The business "${businessInput}" has been successfully verified... [etc]`
    }
  };

  const getRandomResult = () => {
    const outcomes = ['notFound', 'einMismatch', 'watchlistHit', 'verified'];
    const randomIndex = Math.floor(Math.random() * outcomes.length);
    return outcomes[randomIndex];
  };

  const handleCheckStatus = () => {
    if (!businessInput.trim()) return;

    setIsLoading(true);
    setTimeout(() => {
      const outcome = getRandomResult();
      setResult(responses[outcome]);
      setIsLoading(false);
    }, 1300);
  };

  const handleCopyResponse = async () => {
    if (!result) return;
    try {
      await navigator.clipboard.writeText(result.message);
      setCopied(true);
      setTimeout(() => setCopied(false), 2000);
    } catch (err) {
      console.error('Copy failed:', err);
    }
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter') handleCheckStatus();
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-indigo-50 to-blue-100 flex items-center justify-center px-4 py-12">
      <div className="glass-card max-w-4xl w-full p-8 shadow-xl rounded-2xl">
        <div className="text-center mb-8">
          <h1 className="text-3xl font-bold text-gray-900 mb-2">
            Business Identity Troubleshooting Companion
          </h1>
          <p className="text-gray-600 text-lg">
            Enter a business name or EIN to check verification status and get support guidance
          </p>
        </div>

        <div className="flex flex-col sm:flex-row gap-4 mb-6">
          <input
            value={businessInput}
            onChange={(e) => setBusinessInput(e.target.value)}
            onKeyPress={handleKeyPress}
            placeholder="Enter business name or EIN..."
            className="flex-1 px-4 py-3 border border-gray-300 rounded-lg text-lg focus:ring-2 focus:ring-blue-500 focus:border-transparent outline-none transition"
          />
          <button
            onClick={handleCheckStatus}
            disabled={!businessInput.trim() || isLoading}
            className="px-6 py-3 bg-blue-600 text-white rounded-lg hover:bg-blue-700 disabled:opacity-50 disabled:cursor-not-allowed flex items-center justify-center gap-2 font-medium transition-colors"
          >
            {isLoading ? (
              <>
                <div className="animate-spin rounded-full h-5 w-5 border-b-2 border-white"></div>
                Checking...
              </>
            ) : (
              <>
                <Search className="w-5 h-5" />
                Check Status
              </>
            )}
          </button>
        </div>

        {result ? (
          <div className={`border-2 rounded-xl p-6 ${result.color}`}>
            <div className="flex items-center justify-between mb-4">
              <div className="flex items-center gap-3">
                {result.icon}
                <h2 className="text-xl font-semibold text-gray-900">{result.status}</h2>
              </div>
              <button
                onClick={handleCopyResponse}
                className="flex items-center gap-2 px-4 py-2 bg-white border border-gray-300 rounded-lg hover:bg-gray-50 transition"
              >
                <Copy className="w-4 h-4" />
                {copied ? 'Copied!' : 'Copy Response'}
              </button>
            </div>

            <div className="bg-white border border-gray-200 rounded-md p-4">
              <pre className="whitespace-pre-wrap text-sm text-gray-700 leading-relaxed font-sans">
                {result.message}
              </pre>
            </div>
          </div>
        ) : (
          <div className="text-center text-gray-500 py-10">
            <Search className="w-10 h-10 mx-auto mb-3 opacity-30" />
            <p>Enter a business name or EIN above and click "Check Status" to get started</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default App;
